import React from 'react'
import './App.css';
import {Main} from "./components/Main";
import {Route} from "react-router-dom";
import {Game} from "./components/Play";

const App = () => {
    return (
        <div className="App">
            <Main/>
            <Route path='/game' render={()=> <Game/>}/>
        </div>
    );
}

export default App;
